import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://cdn4.vectorstock.com/i/1000x1000/22/23/work-from-home-stay-at-home-teleconference-for-vector-30362223.jpg" />
      </header>
    </div>
  );
}

export default App;
